CREATE TABLE `albums` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `genres_id` int unsigned NOT NULL,
  `artists_id` int unsigned NOT NULL,
  `year` year NOT NULL DEFAULT (year(curdate())),
  `album` varchar(200) NOT NULL,
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modified` datetime NOT NULL DEFAULT '1000-01-01 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `users_id` int unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_albums_artists_idx` (`artists_id`),
  KEY `fk_albums_genres_idx` (`genres_id`),
  KEY `fk_albums_users1_idx` (`users_id`),
  CONSTRAINT `fk_albums_artists` FOREIGN KEY (`artists_id`) REFERENCES `artists` (`id`),
  CONSTRAINT `fk_albums_genres` FOREIGN KEY (`genres_id`) REFERENCES `genres` (`id`),
  CONSTRAINT `fk_albums_users1` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1142 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
